INSERT INTO `noticias` (`id`, `titulo`, `descricao`, `data_publicacao`, `autor`, `foto`, `status`) VALUES
(1, 'Prefeito Antian é homenageado com a medalha Centenário do Corpo de Bombeiros', 'O prefeito de Paraguaçu Paulista, Antônio Takashi Sasada, foi homenageado com a medalha Centenário do Corpo de Bombeiros, em cerimônia realizada na Escola Superior de Bombeiros, em Franco da Rocha, na quinta-feira (10). \r\n\r\nEssa medalha foi criada quando do aniversário de 100 anos do Corpo de Bombeiros. A cada ano, a honraria é outorgada a autoridades civis e militares ou instituições que tenham contribuído para enaltecer o trabalho dos profissionais que atuam, direta e indiretamente, para elevar o nome da Polícia Militar do Estado de São Paulo, bem como tenham um histórico de contribuição para com a melhoria da sociedade. A escolha dos indicados é realizada por uma comissão e ratificada pelo comandante-geral da Polícia Militar do Estado de São Paulo, coronel Fernando Alencar Medeiros.\r\n\r\nDa região do 14º Grupamento de Bombeiros, que compreende 67 cidades do Oeste Paulista, somente três pessoas foram indicadas para receber a medalha Centenário do Corpo de Bombeiro, entre elas prefeito de Paraguaçu Paulista, Antian Sasada. \r\n\r\nNa solenidade de entrega da Medalha Centenário do Corpo de Bombeiro ao prefeito Antian, que estava acompanhado da primeira dama Denise Miyuki Tanabe Sasada, estiveram presentes também autoridades como o 1º sargento Valdemar, Comandante da Estação de Rosana e Teodoro Sampaio, o capitão PM Marçal, comandante do 4º Subgrupamento de Bombeiros de Assis e que compreende a região de Paraguaçu Paulista, o coronel PM Vitorino, Comandante do 14º Grupamento de Bombeiros, entre outros.', '2022-03-12', 'https://www.i7noticias.com', , '');
